import React, { Component } from 'react'
import Nav from '../Nav'
import { Link } from 'react-router-dom'

class Menu extends Component {
  onLogoutClick = (e) => {
    e.preventDefault()
    this.props.logoutUser()
  }

  render() {
    return (
      <>
        <Nav />
        <div>
          <Link to="/camera">
            <h1>Camera</h1>
          </Link>
        </div>
      </>
    )
  }
}

export default Menu
